-- Name: clean_committee(character); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.clean_committee(p_cmte_id character) RETURNS text
    LANGUAGE plpgsql
    AS $$
declare 
 cur_del CURSOR FOR
	
SELECT  table_name
	   FROM information_schema.tables
	   WHERE  table_schema='public' and (table_name like 'sched%' or table_name in ('entity', 'excluded_entity', 'reports'));
v_table text;
begin
   OPEN cur_del;  
 loop
  fetch cur_del into v_table;
   EXIT WHEN NOT FOUND;
  -- RAISE NOTICE 'delete from % where repid= %',v_table,p_repid;
    execute 'delete from public.'||v_table ||' where cmte_id='''||p_cmte_id||'''';
 end loop;
close cur_del; 
return 'SUCCESS';
end
$$;


