delete from public.dcf_sched_h2 where cmte_id = p_cmte_id;
delete from public.dcf_sched_h3 where cmte_id = p_cmte_id;
delete from public.dcf_sched_h4 where cmte_id = p_cmte_id;
delete from public.dcf_sched_h5 where cmte_id = p_cmte_id;
