    LANGUAGE plpgsql
    AS $$

declare
v_json JSON;
begin
/* Desired way of doing, will work with frontend and check if posible 
select json_agg(json_build_object('name',validation_type,'validator',validation_rule,'message',validation_message)) INTO v_json 
