--
-- Name: get_jf_memo_types(character varying, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.get_jf_memo_types(p_form_type character varying, p_tran_identifier character varying) RETURNS json
    LANGUAGE plpgsql
    AS $$

declare
v_json JSON; 
begin
/* This will get the JF memo type for a transaction */
 select 
 json_agg(json_build_object('memoType', c.tran_desc, 'lineNumber',c.line_num,'transactionIdentifier',tran_identifier,'transactionCode',tran_code,
						    'entityType',(case when tran_identifier like '%IND%' THEN 'IND'
										 		when tran_identifier like '%PAC%' THEN 'COM'
										  	  	when tran_identifier like '%PARTY%' THEN 'COM'
										        else 'ORG' END
										 )
						   )) INTO v_json
from ref_transaction_types c where c.parent_tran_id in (select p.ref_tran_id from ref_transaction_types p where p.tran_identifier=p_tran_identifier);
return v_json;
end;

$$;


--
-- Name: get_latest_amend_report(bigint); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.get_latest_amend_report(reportid bigint) RETURNS bigint
    LANGUAGE plpgsql
    AS $$
DECLARE
    i bigint;
    super_id bigint;
BEGIN
    i = reportid;
    WHILE (i is not null)
    loop
    super_id = i;
    SELECT superceded_report_id INTO i FROM reports WHERE report_id = super_id;
    end loop;
    RETURN super_id;
END;
$$;


