end;
$$;


--
-- Name: get_next_report_id(character varying, numeric, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.get_next_report_id(pv_cmte_id character varying, pn_rpt_yr numeric, pv_rpt_tp character varying) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
     ln_report_id NUMERIC := 0;
BEGIN
     IF (
             pv_cmte_id IS NOT NULL 
         AND pv_rpt_tp IS NOT NULL
         AND pn_rpt_yr IS NOT NULL
        )
     THEN
          BEGIN
               SELECT rep_id
                 INTO ln_report_id
                 FROM reports r
                WHERE r.rpt_yr = pn_rpt_yr
                  AND r.rpt_tp = pv_rpt_tp
                  AND UPPER(r.status) = 'SAVED'
                  AND ROWNUM < 2;
          EXCEPTION
               WHEN OTHERS
               THEN
                    ln_report_id := NEXTVAL('report_id_seq');
          END;
     ELSE
          ln_report_id := NEXTVAL('report_id_seq');
     END IF;
     RETURN ln_report_id;
END;
$$;


--
-- Name: get_next_report_id_string(character varying, numeric, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.get_next_report_id_string(pv_cmte_id character varying, pn_rpt_yr numeric, pv_rpt_tp character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE
     ln_report_id NUMERIC := 0;
     ln_report_id_string CHARACTER VARYING(100) := NULL;
BEGIN
     IF (
             pv_cmte_id IS NOT NULL 
         AND pv_rpt_tp IS NOT NULL
         AND pn_rpt_yr IS NOT NULL
        )
     THEN
          BEGIN
               SELECT reps.rep_id
                 INTO ln_report_id
                 FROM (
                           SELECT rep_id
                             FROM reports r
                            WHERE r.rpt_yr = pn_rpt_yr
                              AND r.rpt_tp = pv_rpt_tp
                              AND UPPER(r.status) = 'SAVED'
                            ORDER BY rep_id
                      ) reps
                WHERE ROWNUM < 2;

               ln_report_id_string := TO_CHAR(ln_report_id) || '_OLD';

          EXCEPTION
               WHEN OTHERS
               THEN
                    ln_report_id := NEXTVAL('report_id_seq');
                    ln_report_id_string := TO_CHAR(ln_report_id) || '_NEW';
          END;
     ELSE
          ln_report_id        := NEXTVAL('report_id_seq');
          ln_report_id_string := TO_CHAR(ln_report_id) || '_NEW';
     END IF;
     RETURN ln_report_id_string;
END;
$$;


