--
-- Name: get_sub_transaction_json(character varying, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.get_sub_transaction_json(p_form_type character varying, p_tran_identifier character varying) RETURNS json
    LANGUAGE plpgsql
    AS $$

declare
v_json JSON;
v_parent_tran_id integer;
v_tran_identifier character varying(90);
is_parent boolean;
is_earmark boolean;
begin
/* This will give the sub-transactions when you enter a parent or child transaction identifier*/

  select  COALESCE (parent_tran_id, null,0) into v_parent_tran_id 
      from ref_transaction_types 
          where form_type=p_form_type 
              and tran_identifier=p_tran_identifier;
       
              
    if v_parent_tran_id > 0 then
    /*If this is a child then find parent*/
      is_parent = false;
    select  tran_identifier  into v_tran_identifier from   ref_transaction_types 
          where form_type=p_form_type and ref_tran_id=v_parent_tran_id;     
  else
      is_parent = true;
        v_tran_identifier = p_tran_identifier;
    end if;
  
  if upper(p_tran_identifier) like '%EAR%' then
    is_earmark = true;
  else
    is_earmark = false;
  end if;   
  
  SELECT json_agg(json_build_object('transactionType', parent.tran_identifier, 
                                                         'transactionTypeDescription', parent.tran_desc, 
                                                         'scheduleType', parent.sched_type, 
                                                         'subTransactionType', child.tran_identifier, 
                                                         'subScheduleType', child.sched_type,                                                         
                                                         'subTransactionTypeDescription', child.tran_desc,
                                                'api_call',(case when parent.sched_type ='sched_a' then '/sa/schedA'
                                                                       when parent.sched_type ='sched_b' then '/sb/schedB'
                                     when parent.sched_type ='sched_c' then '/sc/schedC'
                                       when parent.sched_type ='sched_d' then '/sd/schedD'                                     
                                     when parent.sched_type ='sched_e' then '/se/schedE'                                 
                                     when parent.sched_type ='sched_h1' then '/sh1/schedH1'
                                     when parent.sched_type ='sched_h2' then '/sh2/schedH2'
                                     when parent.sched_type ='sched_h3' then '/sh3/schedH3'
                                     when parent.sched_type ='sched_h4' then '/sh4/schedH4'
                                       when parent.sched_type ='sched_h5' then '/sh5/schedH5'
                                     when parent.sched_type ='sched_h6' then '/sh6/schedH6'
                                                                      else '/sa/schedA'
                                                                   end),
                                                         'isParent',is_parent,
                               'isEarmark',is_earmark
                                                        ) ORDER BY child.ref_tran_id) into v_json
           FROM ref_transaction_types parent
            JOIN ref_transaction_types child ON parent.ref_tran_id = child.parent_tran_id
            where parent.tran_identifier=v_tran_identifier
       and parent.auto_generate = false;/* Excluding auto generated transactions*/
return v_json;
end;

$$;


--
-- Name: get_transaction_code_from_transaction_identifier(character varying, character varying, character varying, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.get_transaction_code_from_transaction_identifier(pv_form_tp character varying, pv_schedule_type character varying, pv_line_number character varying, pv_transaction_identifier character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE
     lv_schema       CHARACTER VARYING(100) := 'PUBLIC';
     lv_process_name CHARACTER VARYING(100) := 'GET_TRANSACTION_CODE_FROM_TRANSACTION_IDENTIFIER';
     lv_transaction_code CHARACTER VARYING(5) := NULL;
BEGIN
     IF (
              pv_form_tp IS NOT NULL
          AND pv_schedule_type IS NOT NULL
          AND pn_line_number IS NOT NULL
          AND pv_transaction_identifier IS NOT NULL
        )
     THEN
          BEGIN
               SELECT rtt.tran_code
                 INTO lv_transaction_code
                 FROM ref_transaction_types rtt
                WHERE UPPER(rtt.form_type)       = UPPER(pv_form_tp)
                  AND UPPER(rt.sched_type)       = UPPER(pv_schedule_type)
                  AND UPPER(rtt.line_num)        = UPPER(pv_line_number)
                  AND UPPER(rtt.tran_identifier) = UPPER(pv_transaction_identifier);
          EXCEPTION
               WHEN OTHERS
               THEN
                    lv_transaction_code := NULL;
          END;
     ELSE
          BEGIN
               SELECT rtt.tran_code
                 INTO lv_transaction_code
                 FROM ref_transaction_types rtt
                WHERE UPPER(rtt.tran_identifier)  = UPPER(pv_transaction_identifier);
          EXCEPTION
               WHEN OTHERS
               THEN
                    lv_transaction_code := NULL;
          END;
     END IF;

     RETURN lv_transaction_code;
EXCEPTION
     WHEN OTHERS
     THEN
          RAISE;
END;
$$;


--
-- Name: import_schedule_a(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.import_schedule_a(pv_table_name character varying) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
     --Constants
     lv_schema           CHARACTER VARYING(100)        := 'PUBLIC';
     lv_process_name     CHARACTER VARYING(100)        := 'IMPORT_SCHEDULE_A';
     lv_form_tp          CHARACTER VARYING(5)          := UPPER(SPLIT_PART(pv_table_name, '_', 1));
     lv_schedule         CHARACTER VARYING(10)         := 'sched_a';
     lv_cmte_id          CHARACTER VARYING(9)          := UPPER(RIGHT(pv_table_name, 9));
     lv_contacts_table   CHARACTER VARYING(1000)       := 'contacts_' || pv_table_name;
     lv_alter_table_statement CHARACTER VARYING(5000)  := 'ALTER TABLE ' || pv_table_name || '
                                                           ADD COLUMN reportid NUMERIC, 
                                                           ADD COLUMN transactionid NUMERIC, 
                                                           ADD COLUMN backreftransactionid NUMERIC, 
                                                           ADD COLUMN transactioncode CHARACTER VARYING(5),
                                                           ADD COLUMN entityid CHARACTER VARYING(100),
                                                           ADD COLUMN donorcmtenm CHARACTER VARYING(200)';

     lv_select_statement CHARACTER VARYING(1000)   := NULL;
     lv_update_statement CHARACTER VARYING(5000);
     lv_final_insert_statement CHARACTER VARYING(10000) := NULL;
     lv_report_id_create CHARACTER VARYING(5000) := 'SELECT DISTINCT f.reportyear, f.reporttype FROM public.'|| pv_table_name ||' f WHERE f.reportid IS NULL';
     ln_report_id NUMERIC := 0;

     rec RECORD;     
BEGIN
     PERFORM public.log_step('Begin Processing Schedule A');
     PERFORM public.log_step('Committee ID - ' || lv_cmte_id);

     PERFORM public.log_step('Rename Columns To No Special Character');
     PERFORM public.rename_columns_to_no_special_character(pv_table_name => pv_table_name);
     PERFORM public.log_step('Rename Columns To No Special Character - Done');

     PERFORM public.log_step('Add columns');
     EXECUTE(lv_alter_table_statement);
     PERFORM public.log_step('Add columns - End');

     --Update Transaction ID
     PERFORM public.log_step('Update Transaction ID');
     lv_update_statement := 'UPDATE ' || pv_table_name || ' s SET transactionid = NEXTVAL(''transaction_id_seq'')';
     PERFORM public.log_step('Transaction ID Update Statement is - ' || lv_update_statement);
     EXECUTE(lv_update_statement);
     PERFORM public.log_step('Update Transaction ID - End');

     --Update Transaction Code
     PERFORM public.log_step('Update Transaction Code');
     lv_update_statement := 'UPDATE ' || pv_table_name || ' s SET transactioncode = (
                                                                                           SELECT rtt.tran_code
                                                                                             FROM ref_transaction_types rtt
                                                                                            WHERE rtt.sched_type = ''' ||lv_schedule || '''
                                                                                              AND rtt.tran_identifier = s.transactionidentifier
                                                                                              AND rtt.line_num = SUBSTRING(s.schedulename, 3)
                                                                                              AND rtt.form_type = ''' ||lv_form_tp || '''
                                                                                              LIMIT 1
                                                                                      )';
     PERFORM public.log_step('Transaction Code Update Statement is - ' || lv_update_statement);
     EXECUTE(lv_update_statement);
     PERFORM public.log_step('Update Transaction ID - End');

     --Update Back Ref Transaction ID
     PERFORM public.log_step('Update Back Ref Transaction ID');
     lv_update_statement := 'UPDATE ' || pv_table_name || ' t SET backreftransactionid = (
                                                                                              SELECT ti.transactionid
                                                                                                FROM ' || pv_table_name || ' ti
                                                                                               WHERE ti.transactionnumber = SUBSTR(t.transactionnumber , 1, POSITION(''.'' IN t.transactionnumber)-1)
                                                                                               LIMIT 1
                                                                                          )
                              WHERE POSITION(''.'' IN t.transactionnumber) > 0;';
     PERFORM public.log_step('Back Ref Transaction ID Update Statement 1 is - ' || lv_update_statement);
     EXECUTE(lv_update_statement);
     PERFORM public.log_step('Update Back Ref Transaction ID - Done');

     --Update Report ID
     PERFORM public.log_step('Update Report ID');
     lv_update_statement := 'UPDATE ' || pv_table_name || ' s SET reportid = (
                                                                                  SELECT report_id
                                                                                    FROM reports r
                                                                                   WHERE r.cmte_id = ''' || lv_cmte_id ||'''
                                                                                     AND r.report_type = s.reporttype
                                                                                     AND EXTRACT(YEAR FROM r.cvg_end_date) = CAST(s.reportyear AS INTEGER)
                                                                                     AND UPPER(r.status) = ''SAVED''
                                                                             )';
     PERFORM public.log_step('Report ID Update Statement is - ' || lv_update_statement);
     EXECUTE(lv_update_statement);
     PERFORM public.log_step('Update Report ID - End');

     FOR rec IN EXECUTE(lv_report_id_create)
     LOOP
          ln_report_id := public.get_next_report_id(
                                                        pv_cmte_id => lv_cmte_id
                                                      , pn_rpt_yr  => CAST(rec.reportyear AS INTEGER)
                                                      , pv_rpt_tp  => rec.reporttype
                                                   );


                                         report_id 
                                       , report_type
                                       , cvg_end_date
                                       , form_type
                                       , amend_ind
                                       , cmte_id
                                       , report_seq
                                       , status
                                    )
                              VALUES(
                                         ln_report_id
                                       , rec.reporttype
                                       , TO_DATE('31-DEC-'||rec.reportyear, 'DD-MON-YYYY')
                                       , lv_form_tp
                                       , 'N'
                                       , lv_cmte_id
                                       , ln_report_id
                                       , 'Saved'
                                    );
     END LOOP;

     --Update Report ID 2
     PERFORM public.log_step('Update Report ID 2');
     lv_update_statement := 'UPDATE ' || pv_table_name || ' s SET reportid = (
                                                                                  SELECT report_id
                                                                                    FROM reports r
                                                                                   WHERE r.cmte_id = ''' || lv_cmte_id ||'''
                                                                                     AND r.report_type = s.reporttype
                                                                                     AND EXTRACT(YEAR FROM r.cvg_end_date) = CAST(s.reportyear AS INTEGER)
                                                                                     AND UPPER(r.status) = ''SAVED''
                                                                             )
                              WHERE s.reportid IS NULL';
     PERFORM public.log_step('Report ID Update Statement 2 is - ' || lv_update_statement);
     EXECUTE(lv_update_statement);
     PERFORM public.log_step('Update Report ID 2 - End');

     --Update Donor Committee Name
     PERFORM public.log_step('Update Donor Committee Name');
     lv_update_statement := 'UPDATE ' || pv_table_name || ' s 
                                SET donorcmtenm = (
                                                         SELECT cmte_name
                                                           FROM committee_master r
                                                          WHERE r.cmte_id = s.donorcommitteefecid
                                                          LIMIT 1
                                                    )
                               WHERE s.donorcommitteefecid IS NOT NULL';
     PERFORM public.log_step('Donor Committee Name Update Statement is - ' || lv_update_statement);
     EXECUTE(lv_update_statement);
     PERFORM public.log_step('Update Donor Committee Name - End');

     /*
     --Update Entity ID
     PERFORM public.log_step('Update Entity ID');
     lv_update_statement := 'UPDATE ' || pv_table_name || ' s SET entityid = (
                                                                                  SELECT et.entity_id
                                                                                    FROM entity et JOIN ' || lv_contacts_table || ' cts ON (et.entity_id = cts.entity_id)
                                                                                   WHERE UPPER(COALESCE(et.first_name, ''X''))   = UPPER(COALESCE(s.contributorfirstname, ''X''))
                                                                                     AND UPPER(COALESCE(et.last_name, ''X''))    = UPPER(COALESCE(s.contributorlastname, ''X''))
                                                                                     AND UPPER(COALESCE(et.middle_name, ''X''))  = UPPER(COALESCE(s.contributormiddlename, ''X''))
                                                                                     AND UPPER(COALESCE(et.preffix, ''X''))      = UPPER(COALESCE(s.contributorprefix, ''X''))
                                                                                     AND UPPER(COALESCE(et.suffix, ''X''))       = UPPER(COALESCE(s.contributorsuffix, ''X''))
                                                                                   LIMIT 1
                                                                              )';
     PERFORM public.log_step('Entity ID Update Statement is - ' || lv_update_statement);
     EXECUTE(lv_update_statement);
     PERFORM public.log_step('Update Entity ID - End');
     */

     --With all the values available, insert into permanent sched_a table
     --Final Insert Statement
     PERFORM public.log_step('Final Insert Statement');
     lv_final_insert_statement := 
     'INSERT INTO sched_a(
                             cmte_id
                           , report_id
                           , line_number
                           , transaction_type
                           , transaction_id
                           , back_ref_transaction_id
                           , entity_id
                           , contribution_date
                           , contribution_amount
                           , purpose_description
                           , memo_code
                           , memo_text
                           , election_code
                           , election_other_description
                           , create_date
                           , last_update_date
                           , donor_cmte_id
                           , donor_cmte_name
                           , transaction_type_identifier
                           , election_year
                        )
                     SELECT '''|| lv_cmte_id || '''
                          , reportid
                          , SUBSTRING(schedulename, 3) 
                          , transactioncode
                          , transactionid
                          , backreftransactionid
                          , entityid
                          , TO_DATE(contributiondate, ''YYYYMMDD'') 
                          , CAST(contributionamount AS INTEGER) 
                          , receiptdescription
                          , memocode
                          , memodescription
                          , electioncodeyear
                          , electionotherdescription
                          , CURRENT_TIMESTAMP(2)
                          , CURRENT_TIMESTAMP(2)
                          , donorcommitteefecid
                          , donorcmtenm
                          , transactionidentifier
                          , CAST(SUBSTRING(electioncodeyear, 2) AS INTEGER)
                       FROM ' || pv_table_name;
     PERFORM public.log_step('Final Insert Statement is - ' || lv_final_insert_statement);
     EXECUTE(lv_final_insert_statement);
     PERFORM public.log_step('Final Insert Statement - Done');

     PERFORM public.log_step('Transaction Import Log Entry');
     PERFORM public.transaction_import_log_entry(
                                                     pv_table_name  => pv_table_name
                                                   , pv_status      => 'COMPLETED'
                                                   , pv_username_id => '399'
                                                );
     PERFORM public.log_step('Transaction Import Log Entry - Done');

     PERFORM public.log_step('End Processing Schedule A');

     RETURN 0;
EXCEPTION
     WHEN OTHERS
     THEN
/*
          PERFORM public.log_step('Exception Block Processing Schedule A - ' || lv_process_name);
          PERFORM public.log_step('Transaction Import Log Entry');
          PERFORM public.transaction_import_log_entry(
                                                          pv_table_name  => pv_table_name
                                                        , pv_status      => 'ERROR'
                                                        , pv_username_id => '399'
                                                     );
          PERFORM public.log_step('Transaction Import Log Entry - Done');
          PERFORM public.log_step('Exception Block Processing Schedule A - End');
          RETURN 1;
          */
RAISE;
END;
$$;


--
-- Name: import_schedule_b(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.import_schedule_b(pv_table_name character varying) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
     --Constants
     lv_schema           CHARACTER VARYING(100)        := 'PUBLIC';
     lv_process_name     CHARACTER VARYING(100)        := 'IMPORT_SCHEDULE_B';
     lv_form_tp          CHARACTER VARYING(5)          := UPPER(SPLIT_PART(pv_table_name, '_', 1));
     lv_schedule         CHARACTER VARYING(10)         := 'sched_b';
     lv_cmte_id          CHARACTER VARYING(9)          := UPPER(RIGHT(pv_table_name, 9));
     lv_contacts_table   CHARACTER VARYING(1000)       := 'contacts_' || pv_table_name;
     lv_alter_table_statement CHARACTER VARYING(5000)  := 'ALTER TABLE ' || pv_table_name || '
                                                           ADD COLUMN reportid NUMERIC, 
                                                           ADD COLUMN transactionid NUMERIC, 
                                                           ADD COLUMN backreftransactionid NUMERIC, 
                                                           ADD COLUMN transactioncode CHARACTER VARYING(5),
                                                           ADD COLUMN entityid NUMERIC,
                                                           ADD COLUMN beneficiarycmtename CHARACTER VARYING(200),
                                                           ADD COLUMN beneficiarycandentityid NUMBER';
     lv_update_statement CHARACTER VARYING(5000);
     lv_final_insert_statement CHARACTER VARYING(10000) := NULL;
BEGIN
     PERFORM public.log_step('Begin Processing Schedule B');
     PERFORM public.log_step('Committee ID - ' || lv_cmte_id);

     PERFORM public.log_step('Rename Columns To No Special Character');
     PERFORM public.rename_columns_to_no_special_character(pv_table_name => pv_table_name);
     PERFORM public.log_step('Rename Columns To No Special Character - Done');

     PERFORM public.log_step('Add columns');
     EXECUTE(lv_alter_table_statement);
     PERFORM public.log_step('Add columns - End');
     
     --New
     --Update Report ID
     PERFORM public.log_step('Update Report ID');
     lv_update_statement := 'UPDATE ' || pv_table_name || ' s SET reportid = (
                                                                                  SELECT report_id
                                                                                    FROM reports r
                                                                                   WHERE r.cmte_id = ''' || lv_cmte_id ||'''
                                                                                     AND r.report_type = s.reporttype
                                                                                     AND r.report_year = s.reportyear
                                                                                     AND UPPER(r.status) = ''SAVED''
                                                                             )';
     PERFORM public.log_step('Report ID Update Statement is - ' || lv_update_statement);
     EXECUTE(lv_update_statement);
     PERFORM public.log_step('Update Report ID - End');

     --Update Transaction ID
     PERFORM public.log_step('Update Transaction ID');
     lv_update_statement := 'UPDATE ' || pv_table_name || ' s SET transactionid = NEXTVAL(''transaction_id_seq'')';
     PERFORM public.log_step('Transaction ID Update Statement is - ' || lv_update_statement);
     EXECUTE(lv_update_statement);
     PERFORM public.log_step('Update Transaction ID - End');

     --Update Back Ref Transaciton ID
     PERFORM public.log_step('Update Back Ref Transaction Code - 1');
     lv_update_statement := 'UPDATE ' || pv_table_name || ' s SET backreftransactionid = (
                                                                                              SELECT si.transactionid
                                                                                                FROM ' || pv_table_name || ' si
                                                                                               WHERE TO_NUMBER(si.transactionnumber) = TRUNC(TO_NUMBER(s.transactionnumber))
                                                                                          )';
     PERFORM public.log_step('Back Ref Transaction ID Update Statement 1 is - ' || lv_update_statement);
     EXECUTE(lv_update_statement);
     PERFORM public.log_step('Update Back Ref Transaction Code - 1 - Done');

     PERFORM public.log_step('Update Back Ref Transaction Code - 2');
     lv_update_statement := 'UPDATE ' || pv_table_name || ' s SET backreftransactionid = NULL WHERE s.transactionid = s.backreftransactionid';
     PERFORM public.log_step('Back Ref Transaction ID Update Statement 2 is - ' || lv_update_statement);
     EXECUTE(lv_update_statement);
     PERFORM public.log_step('Update Back Ref Transaction Code - 2 - End');

     --Update Transaction Code
     PERFORM public.log_step('Update Transaction Code');
     lv_update_statement := 'UPDATE ' || pv_table_name || ' s SET transactioncode = (
                                                                                           SELECT rtt.tran_code
                                                                                             FROM ref_transaction_types rtt
                                                                                            WHERE rtt.sched_type = ''' ||lv_schedule || '''
                                                                                              AND rtt.tran_identifier = s.transactionidentifier
                                                                                              AND rtt.line_num = SUBSTRING(s.schedulename, 3)
                                                                                              AND rtt.form_type = ''' ||lv_form_tp || '''
                                                                                              LIMIT 1
                                                                                      )';
     PERFORM public.log_step('Transaction Code Update Statement is - ' || lv_update_statement);
     EXECUTE(lv_update_statement);
     PERFORM public.log_step('Update Transaction ID - End');

     --Update Entity ID
     PERFORM public.log_step('Update Entity ID');
     lv_update_statement := 'UPDATE ' || pv_table_name || ' s SET entityid = (
                                                                                  SELECT et.entity_id
                                                                                    FROM entity et
                                                                                   WHERE UPPER(COALESCE(et.first_name, ''X''))   = UPPER(COALESCE(s.payeefirstname, ''X''))
                                                                                     AND UPPER(COALESCE(et.last_name, ''X''))    = UPPER(COALESCE(s.payeelastname, ''X''))
                                                                                     AND UPPER(COALESCE(et.middle_name, ''X''))  = UPPER(COALESCE(s.payeemiddlename, ''X''))
                                                                                     AND UPPER(COALESCE(et.preffix, ''X''))      = UPPER(COALESCE(s.payeeprefix, ''X''))
                                                                                     AND UPPER(COALESCE(et.suffix, ''X''))       = UPPER(COALESCE(s.payeesuffix, ''X''))
                                                                                     AND UPPER(COALESCE(et.street_1, ''X''))       = UPPER(COALESCE(s.payeestreet1, ''X''))
                                                                                     AND UPPER(COALESCE(et.street_2, ''X''))       = UPPER(COALESCE(s.payeestreet2, ''X''))
                                                                                     AND UPPER(COALESCE(et.city, ''X''))       = UPPER(COALESCE(s.payeecity, ''X''))
                                                                                     AND UPPER(COALESCE(et.state, ''X''))       = UPPER(COALESCE(s.payeestate, ''X''))
                                                                                     AND UPPER(COALESCE(et.zip_code, ''X''))       = UPPER(COALESCE(s.payeezip, ''X''))
                                                                                   LIMIT 1
                                                                              )';
     PERFORM public.log_step('Entity ID Update Statement is - ' || lv_update_statement);
     EXECUTE(lv_update_statement);
     PERFORM public.log_step('Update Entity ID - End');

     --Update beneficiary cmte name
     PERFORM public.log_step('Update Beneficiary Committee Name');
     lv_update_statement := 'UPDATE ' || pv_table_name || ' s 
                                SET beneficiarycmtename = (
                                                               SELECT cmte_name
                                                                 FROM committee_master r
                                                                WHERE r.cmte_id = s.beneficiarycommitteefecid
                                                                LIMIT 1
                                                          )
                               WHERE s.beneficiarycommitteefecid IS NOT NULL';
     PERFORM public.log_step('Beneficiary Committee Name Update Statement is - ' || lv_update_statement);
     EXECUTE(lv_update_statement);
     PERFORM public.log_step('Update Beneficiary Committee Name - End');

     --Update Beneficiary Candidate Entity ID
     PERFORM public.log_step('Update Beneficiary Candidate Entity ID');
     lv_update_statement := 'UPDATE ' || pv_table_name || ' s 
                                SET beneficiarycandentityid = (
                                                                   SELECT et.entity_id
                                                                     FROM entity et JOIN ' || lv_contacts_table || ' cts ON (et.entity_id = cts.entity_id)
                                                                    WHERE UPPER(COALESCE(et.cmte_id, ''X''))   = UPPER(COALESCE(s.beneficiarycandidatefecid, ''X''))
                                                                      AND UPPER(COALESCE(et.first_name, ''X''))   = UPPER(COALESCE(s.beneficiarycandidatefirstname, ''X''))
                                                                      AND UPPER(COALESCE(et.last_name, ''X''))    = UPPER(COALESCE(s.beneficiarycandidatelastname, ''X''))
                                                                      AND UPPER(COALESCE(et.middle_name, ''X''))  = UPPER(COALESCE(s.beneficiarycandidatemiddlename, ''X''))
                                                                      AND UPPER(COALESCE(et.preffix, ''X''))      = UPPER(COALESCE(s.beneficiarycandidateprefix, ''X''))
                                                                      AND UPPER(COALESCE(et.suffix, ''X''))       = UPPER(COALESCE(s.beneficiarycandidatesuffix, ''X''))
                                                                    LIMIT 1
                                                              )';
     PERFORM public.log_step('Update Beneficiary Candidate Entity ID Update Statement is - ' || lv_update_statement);
     EXECUTE(lv_update_statement);
     PERFORM public.log_step('Update Entity ID - End');

     --With all the values available, insert into permanent sched_a table
     --Final Insert Statement
     PERFORM public.log_step('Final Insert Statement');
     lv_final_insert_statement := 
     'INSERT INTO sched_b(
                             cmte_id
                           , report_id
                           , line_number
                           , transaction_type
                           , transaction_id
                           , back_ref_transaction_id
                           , entity_id
                           , expenditure_date
                           , expenditure_amount
                           , expenditure_purpose
                           , memo_code
                           , memo_text
                           , election_code
                           , election_other_description
                           , beneficiary_cmte_id
                           , beneficiary_cand_id
                           , create_date
                           , last_update_date
                           , beneficiary_cand_office
                           , beneficiary_cand_state
                           , beneficiary_cand_district
                           , transaction_type_identifier
                           , beneficiary_cmte_name
                           , beneficiary_cand_last_name
                           , beneficiary_cand_first_name
                           , beneficiary_cand_middle_name
                           , beneficiary_cand_prefix
                           , beneficiary_cand_suffix
                           , election_year
                           , beneficiary_cand_entity_id
                        )
                     SELECT '''|| lv_cmte_id || '''
                          , reportid
                          , SUBSTRING(schedulename, 3) 
                          , transactioncode
                          , transactionid
                          , backreftransactionid
                          , entityid
                          , TO_DATE(rec.expendituredate, ''YYYYMMDD'') 
                          , TO_NUMBER(expenditureamount)
                          , purposeofdisbursement
                          , memocode
                          , memodescription
                          , electioncodeyear
                          , electionotherdescription
                          , beneficiarycommitteefecid
                          , beneficiarycandidatefecid
                          , CURRENT_TIMESTAMP(2)
                          , CURRENT_TIMESTAMP(2)
                          , beneficiarycandidateoffice
                          , beneficiarycandidatestate
                          , beneficiarycandidatedistrict
                          , transactionidentifier
                          , beneficiarycmtename
                          , beneficiarycandidatelastname
                          , beneficiarycandidatefirstname
                          , beneficiarycandidatemiddlename
                          , beneficiarycandidateprefix
                          , beneficiarycandidatesuffix
                          , TO_NUMBER(SUBSTRING(electioncodeyear, 2))
                          , beneficiarycandentityid
                       FROM ' || pv_table_name;
     PERFORM public.log_step('Final Insert Statement is - ' || lv_final_insert_statement);
     EXECUTE(lv_final_insert_statement);
     PERFORM public.log_step('Final Insert Statement - Done');

     PERFORM public.log_step('Transaction Import Log Entry');
     PERFORM public.transaction_import_log_entry(
                                                     pv_table_name  => pv_table_name
						   , pv_status      => 'COMPLETED'
                                                   , pv_username_id => '399'
                                                );
     PERFORM public.log_step('Transaction Import Log Entry - Done');

     PERFORM public.log_step('End Processing Schedule B');

     RETURN 0;
EXCEPTION
     WHEN OTHERS
     THEN
          PERFORM public.log_step('Transaction Import Log Entry');
          PERFORM public.transaction_import_log_entry(
                                                          pv_table_name  => pv_table_name
                                                        , pv_status      => 'ERROR'
                                                        , pv_username_id => '399'
                                                     );
          PERFORM public.log_step('Transaction Import Log Entry - Done');
          RAISE;
END;
$$;


--
-- Name: import_schedule_e(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.import_schedule_e(pv_table_name character varying) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
     --Constants
     lv_schema           CHARACTER VARYING(100)        := 'PUBLIC';
     lv_process_name     CHARACTER VARYING(100)        := 'IMPORT_SCHEDULE_E';
     lv_form_tp          CHARACTER VARYING(5)          := UPPER(SPLIT_PART(pv_table_name, '_', 1));
     lv_schedule         CHARACTER VARYING(10)         := 'sched_e';
     lv_cmte_id          CHARACTER VARYING(9)          := UPPER(RIGHT(pv_table_name, 9));
     lv_select_statement CHARACTER VARYING(1000)       := 'SELECT * FROM ' || pv_table_name;
     
     --Local Variables
     --lv_cmte_name CHARACTER VARYING(200) := NULL;
     --report_id
     ln_report_id        NUMERIC                   := 0;
     ln_report_id_string CHARACTER VARYING(100)    := NULL;
     --transaction related
     --lv_transaction_code CHARACTER VARYING(5)      := NULL;
     --lv_line_number      CHARACTER VARYING(10)     := NULL;
     --ln_aggregate_amount NUMERIC;
     
     rec RECORD;

BEGIN
     PERFORM public.log_step('Begin Processing Schedule E');

     PERFORM public.log_step('Rename Columns To No Special Character');
     PERFORM public.rename_columns_to_no_special_character(pv_table_name => pv_table_name);
     PERFORM public.log_step('Rename Columns To No Special Character - Done');

     PERFORM public.log_step('Committee ID - ' || lv_cmte_id);
     PERFORM public.log_step('Select Statement - ' || lv_select_statement);
     
     PERFORM public.log_step('Begin For Loop');

     FOR rec IN EXECUTE(lv_select_statement)
     LOOP
          --Get the next REPORT ID
          BEGIN
               ln_report_id_string := get_next_report_id_string(
                                                                    pv_cmte_id => rec.cmte_id
                                                                  , pn_rpt_yr  => rec.rpt_yr
                                                                  , pn_rpt_tp  => rec.rpt_tp
                                                               );
               ln_report_id := TO_NUMBER(SUBSTRING(ln_report_id_string, 1, POSITION('_' IN ln_report_id_string)-1));
          EXCEPTION
               WHEN OTHERS
               THEN
                    RAISE;
          END;

          --transaction_type_identifier = transactionidentifier
          --transaction_code = transactiontype


                                  cmte_id
                                , report_id
                                , transaction_type_identifier
                                , transaction_id
                                , back_ref_transaction_id
                                , back_ref_sched_name
                                , payee_entity_id
                                , election_code
                                , election_other_desc
                                , dissemination_date
                                , expenditure_amount
                                , disbursement_date
                                , calendar_ytd_amount
                                , purpose
                                , category_code
                                , payee_cmte_id
                                , support_oppose_code
                                , so_cand_id
                                , so_cand_last_name
                                , so_cand_first_name
                                , so_cand_middle_name
                                , so_cand_prefix
                                , so_cand_suffix
                                , so_cand_office
                                , so_cand_district
                                , so_cand_state
                                , completing_entity_id
                                , date_signed
                                , memo_code
                                , memo_text
                                , delete_ind
                                , create_date
                                , last_update_date
                                , line_number
                                , aggregation_ind
                                , associatedbydissemination
                                , mirror_report_id
                                , mirror_transaction_id
                             )
                       VALUES(
                                  lv_cmte_id                                         --     done --     cmte_id
                                , ln_report_id                                       --     done --     report_id
                                , rec.transactionidentifier                          --     done --     transaction_type_identifier
                                , NEXTVAL('transaction_id_seq')                      --     done --     transaction_id
                                , NULL                                               -- not done --     back_ref_transaction_id
                                , NULL                                               -- not done --     back_ref_sched_name
                                , NULL                                               -- not done --     payee_entity_id
                                , rec.electioncodeyear                               --     done --     election_code
                                , rec.electionotherdesc                              --     done --     election_other_desc
                                , TO_DATE(rec.disseminationdate, 'YYYYMMDD')         --     done --     dissemination_date
                                , TO_NUMBER(rec.expenditureamount)                   --     done --     expenditure_amount
                                , TO_DATE(rec.disbursementdate, 'YYYYMMDD')          --     done --     disbursement_date
                                , NULL                                               -- not done --     calendar_ytd_amount
                                , rec.purposeofdesbursement                          --     done --     purpose
                                , NULL                                               -- not done --     category_code
                                , rec.payeecmtefecidnumber                           --     done --     payee_cmte_id
                                , rec.supportopposecode                              --     done --     support_oppose_code
                                , rec.socandidateidnumber                            --     done --     so_cand_id
                                , rec.socandidatelastname                            --     done --     so_cand_last_name
                                , rec.socandidatefirstname                           --     done --     so_cand_first_name
                                , rec.socandidatemiddlename                          --     done --     so_cand_middle_name
                                , rec.socandidateprefix                              --     done --     so_cand_prefix
                                , rec.socandidatesuffix                              --     done --     so_cand_suffix
                                , rec.socandidateoffice                              --     done --     so_cand_office
                                , rec.socandidatedistrict                            --     done --     so_cand_district
                                , rec.socandidatestate                               --     done --     so_cand_state
                                , NULL                                               -- not done --     completing_entity_id
                                , NULL                                               -- not done --     date_signed
                                , rec.memocode                                       --     done --     memo_code
                                , rec.memotext                                       --     done --     memo_text
                                , CURRENTTIMESTAMP(2)                                --     done --     create_date
                                , CURRENTTIMESTAMP(2)                                --     done --     last_update_date
                                , '24'                                               --     done --     line_number
                                , NULL                                               -- not done --     aggregation_ind
                                , NULL                                               -- not done --     associatedbydissemination
                                , NULL                                               -- not done --     mirror_report_id
                                , NULL                                               -- not done --     mirror_transaction_id
                             );
     END LOOP;
     PERFORM public.log_step('Transaction Import Log Entry');
     PERFORM public.transaction_import_log_entry(
                                                     pv_table_name  => pv_table_name
						   , pv_status      => 'COMPLETED'
                                                   , pv_username_id => '399'
                                                );
     PERFORM public.log_step('Transaction Import Log Entry - Done');
     PERFORM public.log_step('End Processing Schedule E');

     RETURN 0;
EXCEPTION
     WHEN OTHERS
     THEN
          PERFORM public.log_step('Transaction Import Log Entry');
          PERFORM public.transaction_import_log_entry(
                                                          pv_table_name  => pv_table_name
                                                        , pv_status      => 'ERROR'
                                                        , pv_username_id => '399'
                                                     );
          PERFORM public.log_step('Transaction Import Log Entry - Done');
          RETURN 1;
END;
$$;


--
-- Name: import_schedule_f(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.import_schedule_f(pv_table_name character varying) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
     --Constants
     lv_schema           CHARACTER VARYING(100)        := 'PUBLIC';
     lv_process_name     CHARACTER VARYING(100)        := 'IMPORT_SCHEDULE_F';
     lv_form_tp          CHARACTER VARYING(5)          := UPPER(SPLIT_PART(pv_table_name, '_', 1));
     lv_schedule         CHARACTER VARYING(10)         := 'sched_f';
     lv_cmte_id          CHARACTER VARYING(9)          := UPPER(RIGHT(pv_table_name, 9));
     lv_select_statement CHARACTER VARYING(1000)   := 'SELECT * FROM ' || pv_table_name;
     
     --Local Variables
     --lv_cmte_name CHARACTER VARYING(200) := NULL;
     --report_id
     ln_report_id        NUMERIC                   := 0;
     lv_report_id_string CHARACTER VARYING(100)    := NULL;
     --transaction related
     lv_transaction_code CHARACTER VARYING(5)      := NULL;
     --lv_line_number      CHARACTER VARYING(10)     := NULL;
     --ln_aggregate_amount NUMERIC;
     
     rec RECORD;

BEGIN
     PERFORM public.log_step('Begin Processing Schedule F');
     PERFORM public.log_step('Rename Columns To No Special Character');
     PERFORM public.rename_columns_to_no_special_character(pv_table_name => pv_table_name);
     PERFORM public.log_step('Rename Columns To No Special Character - Done');

     PERFORM public.log_step('Committee ID - ' || lv_cmte_id);
     PERFORM public.log_step('Select Statement - ' || lv_select_statement);
     
     PERFORM public.log_step('Begin For Loop');
     FOR rec IN EXECUTE(lv_select_statement)
     LOOP
          --Line Number
          --lv_line_number := SUBSTRING(schedulename, 3);

          --Get the next REPORT ID
          BEGIN
               lv_report_id_string := get_next_report_id_string(
                                                                    pv_cmte_id => rec.cmte_id
                                                                  , pn_rpt_yr  => rec.rpt_yr
                                                                  , pn_rpt_tp  => rec.rpt_tp
                                                               );
               ln_report_id := TO_NUMBER(SUBSTRING(ln_report_id_string, 1, POSITION('_' IN ln_report_id_string)-1));
          EXCEPTION
               WHEN OTHERS
               THEN
                    RAISE;
          END;

          --Get Transaction Code
          BEGIN
               lv_transaction_code := get_transaction_code_from_transaction_identifier(
                                                                                           pv_form_tp                => lv_form_tp
                                                                                         , pv_schedule_type          => lv_schedule
                                                                                         , pv_line_number            => lv_line_number
                                                                                         , pv_transaction_identifier => rec.transactionidentifier
                                                                                      );
          EXCEPTION
               WHEN OTHERS
               THEN
                    lv_transaction_code := NULL;
          END;

          --transaction_type_identifier = transactionidentifier
          --transaction_code = transactiontype


                                  cmte_id
                                , report_id
                                , transaction_type_identifier
                                , transaction_id
                                , back_ref_transaction_id
                                , back_ref_sched_name
                                , coordinated_exp_ind
                                , designating_cmte_id
                                , designating_cmte_name
                                , subordinate_cmte_id
                                , subordinate_cmte_name
                                , subordinate_cmte_street_1
                                , subordinate_cmte_street_2
                                , subordinate_cmte_city
                                , subordinate_cmte_state
                                , subordinate_cmte_zip
                                , payee_entity_id
                                , expenditure_date
                                , expenditure_amount
                                , aggregate_general_elec_exp
                                , purpose
                                , category_code
                                , payee_cmte_id
                                , payee_cand_id
                                , payee_cand_last_name
                                , payee_cand_fist_name
                                , payee_cand_middle_name
                                , payee_cand_prefix
                                , payee_cand_suffix
                                , payee_cand_office
                                , payee_cand_state
                                , payee_cand_district
                                , memo_code
                                , memo_text
                                , delete_ind
                                , create_date
                                , last_update_date
                                , line_number
                                , transaction_type
                                , aggregation_ind
                             )
                       VALUES(
                                  lv_cmte_id                                                                          --     done --     cmte_id
                                , ln_report_id                                                                        --     done --     report_id
                                , rec.transactionidentifier                                                           --     done --     transaction_type_identifier
                                , NEXTVAL('transaction_id_seq')                                                       --     done --     transaction_id
                                , NULL                                                                                -- not done --     back_ref_transaction_id
                                , NULL                                                                                -- not done --     back_ref_sched_name
                                , rec.ynhasfilerbeendesignatedtomakecoordinatedexpenditures                           --     done --     coordinated_exp_ind
                                , rec.designatingcommitteeid                                                          --     done --     designating_cmte_id
                                , rec.designatingcommitteename                                                        --     done --     designating_cmte_name
                                , rec.subordinatecommitteeid                                                          --     done --     subordinate_cmte_id
                                , rec.subordinatecommitteename                                                        --     done --     subordinate_cmte_name
                                , rec.subordinatestreet1                                                              --     done --     subordinate_cmte_street_1
                                , rec.subordinatestreet2                                                              --     done --     subordinate_cmte_street_2
                                , rec.subordinatecity                                                                 --     done --     subordinate_cmte_city
