     lv_transaction_code CHARACTER VARYING(5)      := NULL;
     --lv_line_number      CHARACTER VARYING(10)     := NULL;
     --ln_aggregate_amount NUMERIC;
     
     rec RECORD;
BEGIN
     PERFORM public.log_step('Begin Processing Schedule H3');
     PERFORM public.log_step('Rename Columns To No Special Character');
     PERFORM public.rename_columns_to_no_special_character(pv_table_name => pv_table_name);
     PERFORM public.log_step('Rename Columns To No Special Character - Done');

     PERFORM public.log_step('Committee ID - ' || lv_cmte_id);
     PERFORM public.log_step('Select Statement - ' || lv_select_statement);
     
     PERFORM public.log_step('Begin For Loop');
     FOR rec IN EXECUTE(lv_select_statement)
     LOOP
          --Line Number
          --lv_line_number := SUBSTRING(schedulename, 3);

          --Get the next REPORT ID
          BEGIN
               lv_report_id_string := get_next_report_id_string(
                                                                    pv_cmte_id => rec.cmte_id
                                                                  , pn_rpt_yr  => rec.rpt_yr
                                                                  , pn_rpt_tp  => rec.rpt_tp
                                                               );
