                                 , back_ref_transaction_id
                                 , back_ref_sched_name
                                 , account_name
                                 , activity_event_type
                                 , activity_event_name
                                 , receipt_date
                                 , total_amount_transferred
                                 , transferred_amount
                                 , memo_code
                                 , memo_text
                                 , delete_ind
                                 , create_date
                                 , last_update_date
                                 , line_number
                                 , transaction_type
                              )
                        VALUES(
                                   lv_cmte_id                                   --     done --    cmte_id
                                 , ln_report_id                                 --     done --    report_id
                                 , rec.transactionidentifier                    --     done --    transaction_type_identifier
                                 , NEXTVAL('transaction_id_seq')                --     done --    transaction_id
                                 , NULL                                         -- not done --    back_ref_transaction_id
                                 , NULL                                         -- not done --    back_ref_sched_name
                                 , rec.accountname                              --     done --    account_name
                                 , rec.eventtype                                --     done --    activity_event_type
