                                 , TO_NUMBER(rec.amount)                        --     done --    transferred_amount
                                 , NULL                                         --     done --    memo_code
                                 , rec.memodescription                          --     done --    memo_text
                                 , CURRENTTIMESTAMP(2)                          --     done --    create_date
                                 , CURRENTTIMESTAMP(2)                          --     done --    last_update_date
                                 , NULL                                         -- not done --    line_number
                                 , lv_transaction_code                          --     done --    transaction_type
                              );
     END LOOP;
     PERFORM public.log_step('End For Loop');
     PERFORM public.log_step('Transaction Import Log Entry');
     PERFORM public.transaction_import_log_entry(
                                                     pv_table_name  => pv_table_name
						   , pv_status      => 'COMPLETED'
                                                   , pv_username_id => '399'
                                                );
     PERFORM public.log_step('Transaction Import Log Entry - Done');
     PERFORM public.log_step('End Processing Schedule H3');

     RETURN 0;
EXCEPTION
     WHEN OTHERS
     THEN
          PERFORM public.log_step('Transaction Import Log Entry');
          PERFORM public.transaction_import_log_entry(
                                                          pv_table_name  => pv_table_name
                                                        , pv_status      => 'ERROR'
                                                        , pv_username_id => '399'
                                                     );
          PERFORM public.log_step('Transaction Import Log Entry - Done');
          RETURN 1;
END;
$$;


