     PERFORM public.log_step('Begin Processing Schedule H6');
     PERFORM public.log_step('Rename Columns To No Special Character');
     PERFORM public.rename_columns_to_no_special_character(pv_table_name => pv_table_name);
     PERFORM public.log_step('Rename Columns To No Special Character - Done');

     PERFORM public.log_step('Committee ID - ' || lv_cmte_id);
     PERFORM public.log_step('Select Statement - ' || lv_select_statement);

     PERFORM public.log_step('Begin For Loop');
     FOR rec IN EXECUTE(lv_select_statement)
     LOOP
          --Line Number
          --lv_line_number := SUBSTRING(schedulename, 3);

          --Get the next REPORT ID
          BEGIN
               lv_report_id_string := get_next_report_id_string(
                                                                    pv_cmte_id => rec.cmte_id
                                                                  , pn_rpt_yr  => rec.rpt_yr
                                                                  , pn_rpt_tp  => rec.rpt_tp
                                                               );
               ln_report_id := TO_NUMBER(SUBSTRING(ln_report_id_string, 1, POSITION('_' IN ln_report_id_string)-1));
          EXCEPTION
               WHEN OTHERS
               THEN
                    RAISE;
          END;

          --Get Transaction Code
          BEGIN
               lv_transaction_code := get_transaction_code_from_transaction_identifier(
                                                                                           pv_form_tp                => lv_form_tp
                                                                                         , pv_schedule_type          => lv_schedule
                                                                                         , pv_line_number            => lv_line_number
                                                                                         , pv_transaction_identifier => rec.transactionidentifier
                                                                                      );
          EXCEPTION
               WHEN OTHERS
               THEN
                    lv_transaction_code := NULL;
          END;

          --transaction_type_identifier = transactionidentifier
          --transaction_code = transactiontype


                                   cmte_id
                                 , report_id
                                 , line_number
                                 , transaction_type_identifier
                                 , transaction_type
                                 , transaction_id
                                 , back_ref_transaction_id
                                 , back_ref_sched_name
                                 , entity_id
                                 , account_event_identifier
                                 , expenditure_date
                                 , total_fed_levin_amount
                                 , federal_share
                                 , levin_share
                                 , activity_event_total_ytd
                                 , expenditure_purpose
                                 , category_code
                                 , activity_event_type
                                 , memo_code
                                 , memo_text
                                 , delete_ind
                                 , create_date
                                 , last_update_date
                                 , aggregation_ind
                              )
                        VALUES(
                                   lv_cmte_id                                   --     done --    cmte_id
                                 , ln_report_id                                 --     done --    report_id
                                 , '30A'                                        --     done --    line_number
                                 , rec.transactionidentifier                    --     done --    transaction_type_identifier
                                 , lv_transaction_code                          --     done --    transaction_type
                                 , NEXTVAL('transaction_id_seq')                --     done --    transaction_id
                                 , NULL                                         -- not done --    back_ref_transaction_id
                                 , NULL                                         -- not done --    back_ref_sched_name
                                 , NULL                                         --     done --    entity_id
                                 , rec.eventtype                                --     done --    account_event_identifier
                                 , TO_DATE(rec.expendituredate, 'YYYYMMDD')     --     done --    expenditure_date
                                 , TO_NUMBER(rec.amount)                        --     done --    total_fed_levin_amount
                                 , NULL                                         -- not done --    federal_share
                                 , NULL                                         -- not done --    levin_share
                                 , NULL                                         -- not done --    activity_event_total_ytd
                                 , rec.purposeofdisbursement                    --     done --    expenditure_purpose
                                 , NULL                                         -- not done --    category_code
                                 , NULL                                         -- not done --    activity_event_type
                                 , rec.memocode                                 --     done --    memo_code
                                 , rec.memodescription                          --     done --    memo_text
                                 , CURRENTSTAMP(2)                              --     done --    create_date
                                 , CURRENTSTAMP(2)                              --     done --    last_update_date
                                 , NULL                                         -- not done --    aggregation_ind
                              );
     END LOOP;
     PERFORM public.log_step('End For Loop');

     PERFORM public.log_step('Transaction Import Log Entry');
     PERFORM public.transaction_import_log_entry(
                                                     pv_table_name  => pv_table_name
						   , pv_status      => 'COMPLETED'
                                                   , pv_username_id => '399'
                                                );
     PERFORM public.log_step('Transaction Import Log Entry - Done');

     PERFORM public.log_step('End Processing Schedule H6');

     RETURN 0;
EXCEPTION
     WHEN OTHERS
     THEN
          PERFORM public.log_step('Transaction Import Log Entry');
          PERFORM public.transaction_import_log_entry(
                                                          pv_table_name  => pv_table_name
                                                        , pv_status      => 'ERROR'
                                                        , pv_username_id => '399'
                                                     );
          PERFORM public.log_step('Transaction Import Log Entry - Done');
          RETURN 1;
END;
$$;


