--
-- Name: import_schedules(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.import_schedules(pv_table_name character varying) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
     lv_schema       CHARACTER VARYING(100) := 'PUBLIC';
     lv_process_name CHARACTER VARYING(100) := 'IMPORT_SCHEDULES';
     lv_schedule     CHARACTER VARYING(20)  := UPPER(SPLIT_PART(pv_table_name, '_', 2));
     ln_import_result NUMERIC               := 0;
     lv_table_name    CHARACTER VARYING(100) := SUBSTR(pv_table_name, 1, POSITION('.csv' IN pv_table_name)-1);
BEGIN
     PERFORM public.log_step('Begin ' || lv_process_name);
     PERFORM public.log_step('pv_table_name ' || pv_table_name);
     PERFORM public.log_step('lv_table_name ' || lv_table_name);
     PERFORM public.log_step('lv_schedule ' || lv_schedule);

     IF lv_schedule = 'SCHEDULEA'
     THEN
          PERFORM public.log_step('Begin Sched A Import');
          ln_import_result := public.import_schedule_a(pv_table_name => lv_table_name);
          PERFORM public.log_step('End Sched A Import');

     --Schedule B
     ELSIF lv_schedule = 'SCHEDULEB'
     THEN

          PERFORM public.log_step('Begin Sched B Import');
          ln_import_result := public.import_schedule_b(pv_table_name => lv_table_name);
          PERFORM public.log_step('End Sched B Import');

     --Schedule E
     ELSIF lv_schedule = 'SCHEDULEE'
     THEN

          PERFORM public.log_step('Begin Sched B Import');
          ln_import_result := public.import_schedule_e(pv_table_name => lv_table_name);
          PERFORM public.log_step('End Sched B Import');

     --Schedule F
     ELSIF lv_schedule = 'SCHEDULEF'
     THEN

          PERFORM public.log_step('Begin Sched B Import');
          ln_import_result := public.import_schedule_f(pv_table_name => lv_table_name);
          PERFORM public.log_step('End Sched B Import');

     --Schedule H3
     ELSIF lv_schedule = 'SCHEDULEH3'
     THEN

          PERFORM public.log_step('Begin Sched H3 Import');
          ln_import_result := public.import_schedule_h3(pv_table_name => lv_table_name);
          PERFORM public.log_step('End Sched H3 Import');

     --Schedule H4
     ELSIF lv_schedule = 'SCHEDULEH4'
     THEN

          PERFORM public.log_step('Begin Sched H4 Import');
          ln_import_result := public.import_schedule_h4(pv_table_name => lv_table_name);
          PERFORM public.log_step('End Sched H4 Import');

     --Schedule h5
     ELSIF lv_schedule = 'SCHEDULEH5'
     THEN

          PERFORM public.log_step('Begin Sched H5 Import');
          ln_import_result := public.import_schedule_h5(pv_table_name => lv_table_name);
          PERFORM public.log_step('End Sched H5 Import');

     --Schedule h6
     ELSIF lv_schedule = 'SCHEDULEH6'
     THEN

          PERFORM public.log_step('Begin Sched H6 Import');
          ln_import_result := public.import_schedule_h6(pv_table_name => lv_table_name);
          PERFORM public.log_step('End Sched H6 Import');

     --Schedule LA
     ELSIF lv_schedule = 'SCHEDULELA'
     THEN

          PERFORM public.log_step('Begin Sched LA Import');
          ln_import_result := public.import_schedule_la(pv_table_name => lv_table_name);
          PERFORM public.log_step('End Sched LA Import');

     --Schedule LB
     ELSIF lv_schedule = 'SCHEDULELB'
     THEN

          PERFORM public.log_step('Begin Sched LB Import');
          ln_import_result := public.import_schedule_lb(pv_table_name => lv_table_name);
          PERFORM public.log_step('End Sched LB Import');

     --Schedule F3LSA
     ELSIF lv_schedule = 'SCHEDULEF3LSA'
     THEN

          PERFORM public.log_step('Begin Sched F3LSA Import');
          ln_import_result := public.import_schedule_f3la(pv_table_name => lv_table_name);
          PERFORM public.log_step('End Sched F3LSA Import');

     --Schedule F3LSB
     ELSIF lv_schedule = 'SCHEDULEF3LSB'
     THEN

          PERFORM public.log_step('Begin Sched F3LSB Import');
          ln_import_result := public.import_schedule_f3lb(pv_table_name => lv_table_name);
          PERFORM public.log_step('End Sched F3LSB Import');

     ELSE
          PERFORM public.log_step('No Schedule Matched'); 
     END IF;

     PERFORM public.log_step('End' || lv_process_name);

     PERFORM public.log_step('Transaction Import Log Entry Of - ' || lv_process_name);
     PERFORM public.transaction_import_log_entry(
                                                     pv_table_name  => pv_table_name
                                                   , pv_status      => 'COMPLETED'
                                                   , pv_username_id => '399'
                                                );
     PERFORM public.log_step('Transaction Import Log Entry - Done');

     RETURN 0;

EXCEPTION
     WHEN OTHERS
     THEN
          PERFORM public.log_step('Transaction Import Log Entry - Error - ' || lv_process_name);
          PERFORM public.transaction_import_log_entry(
                                                          pv_table_name  => pv_table_name
                                                        , pv_status      => 'ERROR'
                                                        , pv_username_id => '399'
                                                     );
          PERFORM public.log_step('Transaction Import Log Entry - Done');
          RETURN 1;
END;
$$;


