--
-- Name: rename_columns_to_no_special_character(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.rename_columns_to_no_special_character(pv_table_name character varying) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
     lv_all_column_names   CHARACTER VARYING(1000) := 'SELECT column_name FROM information_schema.columns WHERE table_name = ' || '''' ||  pv_table_name || '''';
     lv_from_column_name   CHARACTER VARYING(250);
     lv_to_column_name     CHARACTER VARYING(250);
     lv_alter_table_string CHARACTER VARYING(1000) := NULL;
     rec record;
BEGIN
     --PERFORM public.log_step('Begin Processing');
     --PERFORM public.log_step(lv_all_column_names);

     FOR rec IN EXECUTE(lv_all_column_names)
     LOOP
          --PERFORM public.log_step('start');  
          lv_from_column_name := rec.column_name;
          --PERFORM public.log_step(lv_from_column_name);  
          lv_to_column_name := regexp_replace(LOWER(rec.column_name), '[^\w]+','','g');
          --PERFORM public.log_step(lv_to_column_name);  
          lv_alter_table_string := 'ALTER TABLE ' || pv_table_name || ' RENAME COLUMN "' ||lv_from_column_name || '" TO ' || lv_to_column_name ;
          --PERFORM public.log_step(lv_alter_table_string);
          EXECUTE lv_alter_table_string;
          --PERFORM public.log_step('end');
     END LOOP;
     --PERFORM public.log_step('End Processing');
EXCEPTION
     WHEN OTHERS
     THEN
          RAISE;
END;
$$;


