--
-- Name: update_candidate_committee_entity(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.update_candidate_committee_entity() RETURNS character
    LANGUAGE plpgsql
    AS $$
Declare
v_count Integer;
rec record;
cur_committees cursor for select * from Public.committee_master;
cur_candidates cursor for select * from Public.candidate_master;

begin
-- Open the cursor
   OPEN cur_committees;
	
   LOOP
    -- fetch row into the Record
      FETCH cur_committees INTO rec;
    -- exit when no more row to fetch
      EXIT WHEN NOT FOUND;
	  
	  select count(*) into v_count from public.entity where cmte_id='C00000000' and ref_cand_cmte_id=rec.cmte_id;
	  if v_count >= 1 then
	  	UPDATE public.entity
		SET entity_name=rec.cmte_name, street_1=rec.street_1, street_2=rec.street_2, city=rec.city, state=rec.state, 
			zip_code=rec.zip_code, last_update_date=now(),first_name=null, last_name=null, middle_name=null, 
			preffix=null, suffix=null, cand_office=null, cand_office_state=null, cand_office_district=null, 
			cand_election_year=null, principal_campaign_committee=null
		WHERE cmte_id='C00000000' and ref_cand_cmte_id=rec.cmte_id;
	  else 

		entity_id, entity_type, cmte_id, entity_name, street_1, street_2, city, state, zip_code, ref_cand_cmte_id)
		VALUES (public.get_next_entity_id('FEC'), 'COM', 'C00000000' ,rec.cmte_name, rec.street_1, rec.street_2, rec.city, rec.state, 
				rec.zip_code, rec.cmte_id);
	  end if;
   END LOOP;
  
   -- Close the cursor
   CLOSE cur_committees;


-- Open the cursor
   OPEN cur_candidates;
	
   LOOP
    -- fetch row into the Record
      FETCH cur_candidates INTO rec;
    -- exit when no more row to fetch
      EXIT WHEN NOT FOUND;
	  
	  select count(*) into v_count from public.entity where cmte_id='C00000000' and ref_cand_cmte_id=rec.cand_id;
	  if v_count >= 1 then
	  	UPDATE public.entity
		SET first_name=rec.cand_first_name, last_name=rec.cand_last_name, middle_name=rec.cand_middle_name, 
			preffix=rec.cand_prefix, suffix=rec.cand_suffix, street_1=rec.cand_street_1, street_2=rec.cand_street_2, 
			city=rec.cand_city, state=rec.cand_state, zip_code=rec.cand_zip,  
			ref_cand_cmte_id=rec.cand_id, last_update_date=now(), cand_office=rec.cand_office, 
			cand_office_state=rec.cand_office_state, cand_office_district=rec.cand_office_district, 
			cand_election_year=rec.cand_election_year, principal_campaign_committee=rec.principal_campaign_committee,
			entity_name=null
		WHERE cmte_id='C00000000' and ref_cand_cmte_id=rec.cand_id;
	  else 

		entity_id, entity_type, cmte_id, first_name, last_name, middle_name, preffix, suffix, street_1, street_2, city, state, 
			zip_code, ref_cand_cmte_id, cand_office, cand_office_state, cand_office_district, cand_election_year, 
			principal_campaign_committee)
		VALUES (public.get_next_entity_id('FEC'), 'CAN', 'C00000000',rec.cand_first_name, rec.cand_last_name, 
			rec.cand_middle_name, rec.cand_prefix, rec.cand_suffix, rec.cand_street_1, rec.cand_street_2, 
	  		rec.cand_city, rec.cand_state, rec.cand_zip, rec.cand_id, rec.cand_office, rec.cand_office_state, rec.cand_office_district, 
	  		rec.cand_election_year, rec.principal_campaign_committee);
	  end if;
   END LOOP;
  
   -- Close the cursor
   CLOSE cur_candidates;

return 'ok';
end;
$$;


