--
-- Name: all_disbursements_transactions_view; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.all_disbursements_transactions_view AS
 SELECT sb.cmte_id,
    sb.report_id,
        CASE
            WHEN (rp.form_type IS NOT NULL) THEN rp.form_type
            ELSE 'F3X'::character varying
        END AS form_type,
    rp.report_type,
        CASE
            WHEN ((rp.status IS NULL) OR ((rp.status)::text = 'Saved'::text)) THEN 'Saved'::text
            ELSE 'Filed'::text
        END AS reportstatus,
    rrt.rpt_type_desc AS report_desc,
    sb.line_number,
    'sched_b'::text AS transaction_table,
    sb.transaction_type,
        CASE
            WHEN (((tc.tran_type_identifier)::text = (sb.transaction_type_identifier)::text) AND ((tc.form_type)::text = (rp.form_type)::text)) THEN tc.tran_type
            WHEN (((tc.tran_sub_type_identifier)::text = (sb.transaction_type_identifier)::text) AND ((tc.form_type)::text = (rp.form_type)::text)) THEN tc.sub_tran_type
            ELSE rt.tran_desc
        END AS transaction_type_desc,
    sb.transaction_type_identifier,
    sb.transaction_id,
    sb.back_ref_transaction_id,
    sb.back_ref_sched_name,
    sb.entity_id,
        CASE
            WHEN ((e.entity_type)::text = ANY (ARRAY[('IND'::character varying)::text, ('CAN'::character varying)::text])) THEN (((((initcap((e.last_name)::text) || COALESCE((', '::text || initcap((e.first_name)::text)), ''::text)) || COALESCE((', '::text || initcap((e.middle_name)::text)), ''::text)) || COALESCE((', '::text || initcap((e.preffix)::text)), ''::text)) || COALESCE((', '::text || initcap((e.suffix)::text)), ''::text)))::character varying
            ELSE e.entity_name
        END AS name,
    e.street_1,
    e.street_2,
    e.city,
    e.state,
    e.zip_code,
    e.occupation,
    e.employer,
    e.entity_type,
    sb.expenditure_date AS transaction_date,
    sb.expenditure_amount AS transaction_amount,
    COALESCE(sb.aggregate_amt, 0.00) AS aggregate_amt,
    sb.expenditure_purpose AS purpose_description,
    sb.memo_code,
    sb.memo_text,
    sb.election_code,
    sb.election_other_description,
    sb.delete_ind,
    sb.aggregation_ind,
    sb.create_date,
    sb.last_update_date,
    sb.itemized_ind AS itemized,
    '/sb/schedB'::text AS api_call,
    'Schedule B'::text AS schedule,
    rt.category_type,
    sb.election_year,
    sb.beneficiary_cmte_id,
        CASE
            WHEN (sb.delete_ind = 'Y'::bpchar) THEN sb.last_update_date
            WHEN (e.delete_ind = 'Y'::bpchar) THEN e.last_update_date
            ELSE NULL::timestamp without time zone
        END AS deleteddate,
        CASE
            WHEN ((sb.transaction_type_identifier)::text = ANY (ARRAY[('LOAN_OWN_TO_CMTE_OUT'::character varying)::text, ('IK_OUT'::character varying)::text, ('IK_BC_OUT'::character varying)::text, ('PARTY_IK_OUT'::character varying)::text, ('PARTY_IK_BC_OUT'::character varying)::text, ('PAC_IK_OUT'::character varying)::text, ('PAC_IK_BC_OUT'::character varying)::text, ('IK_TRAN_OUT'::character varying)::text, ('IK_TRAN_FEA_OUT'::character varying)::text])) THEN false
            WHEN ((sb.back_ref_transaction_id IS NOT NULL) AND (( SELECT csa.delete_ind
               FROM public.all_transactions_view csa
              WHERE ((csa.transaction_id)::text = (sb.back_ref_transaction_id)::text)) = 'Y'::bpchar)) THEN false
            WHEN ((sb.redesignation_ind)::text = 'A'::text) THEN false
            WHEN (((sb.redesignation_ind)::text = 'R'::text) AND (( SELECT csa1.delete_ind
               FROM public.sched_b csa1
              WHERE ((csa1.transaction_id)::text = (sb.redesignation_id)::text)) = 'Y'::bpchar)) THEN false
            WHEN (((sb.redesignation_ind)::text = 'R'::text) AND (sb.delete_ind = 'Y'::bpchar) AND (( SELECT csa2.redesignation_ind
               FROM public.sched_b csa2
              WHERE ((csa2.transaction_id)::text = (sb.redesignation_id)::text)) IS NOT NULL)) THEN false
            WHEN (rp.delete_ind = 'Y'::bpchar) THEN false
            WHEN (( SELECT
                    CASE
                        WHEN ((crp.status IS NULL) OR ((crp.status)::text = 'Saved'::text)) THEN 'Saved'::text
                        ELSE 'Filed'::text
                    END AS "case"
               FROM public.reports crp
              WHERE (((crp.cmte_id)::text = (sb.cmte_id)::text) AND (crp.report_id = public.get_latest_amend_report(rp.report_id)))) = 'Filed'::text) THEN false
            ELSE true
        END AS iseditable,
        CASE
            WHEN ((sb.transaction_type_identifier)::text = ANY (ARRAY[('OPEXP'::character varying)::text, ('OPEXP_CC_PAY'::character varying)::text, ('OPEXP_STAF_REIM'::character varying)::text, ('OPEXP_PMT_TO_PROL'::character varying)::text, ('OPEXP_VOID'::character varying)::text, ('OPEXP_HQ_ACC_OP_EXP_NP'::character varying)::text, ('OPEXP_CONV_ACC_OP_EXP_NP'::character varying)::text, ('OPEXP_DEBT'::character varying)::text, ('OTH_DISB'::character varying)::text, ('OTH_DISB_CC_PAY'::character varying)::text, ('OTH_DISB_STAF_REIM'::character varying)::text, ('OTH_DISB_PMT_TO_PROL'::character varying)::text, ('OTH_DISB_RECNT'::character varying)::text, ('OTH_DISB_NP_RECNT_ACC'::character varying)::text, ('OTH_DISB_NC_ACC'::character varying)::text, ('OTH_DISB_NC_ACC_CC_PAY'::character varying)::text, ('OTH_DISB_NC_ACC_STAF_REIM'::character varying)::text, ('OTH_DISB_NC_ACC_PMT_TO_PROL'::character varying)::text, ('OTH_DISB_VOID'::character varying)::text, ('REF_CONT_IND'::character varying)::text, ('REF_CONT_IND_VOID'::character varying)::text, ('FEA_100PCT_PAY'::character varying)::text, ('FEA_CC_PAY'::character varying)::text, ('FEA_STAF_REIM'::character varying)::text, ('FEA_PAY_TO_PROL'::character varying)::text, ('FEA_VOID'::character varying)::text, ('FEA_100PCT_DEBT_PAY'::character varying)::text])) THEN true
            ELSE false
        END AS forceitemizable,
        CASE
            WHEN (( SELECT count(cs.transaction_id) AS count
               FROM public.all_transactions_view cs
              WHERE (((cs.back_ref_transaction_id)::text = (sb.transaction_id)::text) AND (cs.delete_ind IS DISTINCT FROM 'Y'::bpchar))) <> 0) THEN true
            ELSE false
        END AS haschild,
        CASE
            WHEN (((sb.transaction_type_identifier)::text = 'CONT_TO_CAN'::text) AND (sb.redesignation_ind IS NULL)) THEN true
            ELSE false
        END AS isredesignatable,
        CASE
            WHEN ((sb.redesignation_ind)::text = 'R'::text) THEN true
            ELSE false
        END AS "isRedesignation",
    NULL::bigint AS mirror_report_id,
    NULL::character varying AS mirror_transaction_id,
    COALESCE(sb.semi_annual_refund_bundled_amount, 0.00) AS semi_annual_refund_bundled_amount
   FROM (((((public.sched_b sb
     JOIN public.entity e ON (((e.entity_id)::text = (sb.entity_id)::text)))
     JOIN public.ref_transaction_types rt ON (((rt.tran_identifier)::text = (sb.transaction_type_identifier)::text)))
     LEFT JOIN public.reports rp ON ((((rp.cmte_id)::text = (sb.cmte_id)::text) AND (rp.report_id = sb.report_id))))
     LEFT JOIN public.ref_rpt_types rrt ON (((rp.report_type)::text = (rrt.rpt_type)::text)))
     LEFT JOIN public.transaction_categories tc ON (((((tc.tran_type_identifier)::text = (sb.transaction_type_identifier)::text) OR ((tc.tran_sub_type_identifier)::text = (sb.transaction_type_identifier)::text)) AND ((tc.cmte_type_category)::text = (( SELECT committee_master.cmte_type_category
           FROM public.committee_master
          WHERE ((committee_master.cmte_id)::text = (sb.cmte_id)::text)))::text))))
  WHERE ((sb.transaction_type_identifier)::text <> ALL (ARRAY[('LEVIN_VOTER_REG'::character varying)::text, ('LEVIN_VOTER_ID'::character varying)::text, ('LEVIN_GOTV'::character varying)::text, ('LEVIN_GEN'::character varying)::text, ('LEVIN_OTH_DISB'::character varying)::text]))
UNION
 SELECT se.cmte_id,
    se.report_id,
        CASE
            WHEN (rp.form_type IS NOT NULL) THEN rp.form_type
            ELSE 'F3X'::character varying
        END AS form_type,
    rp.report_type,
        CASE
            WHEN ((rp.status IS NULL) OR ((rp.status)::text = 'Saved'::text)) THEN 'Saved'::text
            ELSE 'Filed'::text
        END AS reportstatus,
    rrt.rpt_type_desc AS report_desc,
    se.line_number,
    'sched_e'::text AS transaction_table,
    NULL::character varying AS transaction_type,
        CASE
            WHEN (((tc.tran_type_identifier)::text = (se.transaction_type_identifier)::text) AND ((tc.form_type)::text = (rp.form_type)::text)) THEN tc.tran_type
            WHEN (((tc.tran_sub_type_identifier)::text = (se.transaction_type_identifier)::text) AND ((tc.form_type)::text = (rp.form_type)::text)) THEN tc.sub_tran_type
            ELSE rt.tran_desc
        END AS transaction_type_desc,
    se.transaction_type_identifier,
    se.transaction_id,
    se.back_ref_transaction_id,
    se.back_ref_sched_name,
