--
-- Name: df_entity_types_view; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.df_entity_types_view AS
 SELECT df.form_type,
    df.transaction_type,
    rf.entity_type,
    rf.entity_type_description,
    'ind-group'::text AS entity_group,
    ( SELECT
                CASE
                    WHEN (count(*) = 1) THEN true
                    ELSE false
                END AS "case"
           FROM public.dynamic_form_fields d
          WHERE (((d.form_type)::text = (df.form_type)::text) AND ((d.transaction_type)::text = (df.transaction_type)::text) AND ((d.field_label)::text = 'Entity Type'::text) AND ((rf.entity_type)::text = upper((d.field_value)::text)))) AS selected
   FROM (public.df_entity_types df
     JOIN public.ref_entity_types rf ON ((((rf.entity_type)::text = 'CAN'::text) AND (df.can = true))))
UNION
 SELECT df.form_type,
    df.transaction_type,
    rf.entity_type,
    rf.entity_type_description,
    'org-group'::text AS entity_group,
    ( SELECT
                CASE
                    WHEN (count(*) = 1) THEN true
