--
-- Name: report_type_and_due_dates_view; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.report_type_and_due_dates_view AS
 WITH duedate_by_report AS (
         WITH duedate AS (
                 SELECT t.report_type,
                    t.election_state,
                    json_agg(json_build_object('election_date', t.election_date, 'cvg_start_date', t.cvg_start_date, 'cvg_end_date', t.cvg_end_date, 'due_date', t.due_date)) AS dates
                   FROM ( SELECT DISTINCT due_dates.report_type,
                            due_dates.election_state,
                            due_dates.election_date,
                            due_dates.cvg_start_date,
                            due_dates.cvg_end_date,
                            due_dates.due_date
                           FROM public.due_dates
                          WHERE ((due_dates.report_year)::double precision = date_part('year'::text, CURRENT_DATE))
                        UNION
                         SELECT 'TER'::character varying AS "varchar",
                            NULL::character varying AS "varchar",
                            NULL::date AS date,
                            CURRENT_DATE AS "current_date",
                            CURRENT_DATE AS "current_date",
                            NULL::date AS date) t
                  GROUP BY t.report_type, t.election_state
                )
         SELECT duedate.report_type,
            json_agg(json_build_object('state', duedate.election_state, 'state_description', rs.state_description, 'dates', duedate.dates)) AS json_by_state
           FROM (duedate
             LEFT JOIN public.ref_states rs ON (((duedate.election_state)::text = (rs.state_code)::text)))
          GROUP BY duedate.report_type
        )
 SELECT cr.cmte_id,
    cr.form_type,
    (('{ "report_type":'::text || json_agg(json_build_object('report_type', duedate_by_report.report_type, 'report_type_desciption', rrt.rpt_type_desc, 'report_type_info', rrt.rpt_type_info, 'regular_special_report_ind', rrt.regular_special_report_ind, 'default_disp_ind', public.is_default_report((cr.cmte_id)::bpchar, (duedate_by_report.report_type)::bpchar), 'election_state', duedate_by_report.json_by_state) ORDER BY rrt.rpt_type_order)) || '}'::text) AS report_types_json
   FROM ((duedate_by_report
     JOIN public.ref_rpt_types rrt ON (((duedate_by_report.report_type)::text = (rrt.rpt_type)::text)))
     JOIN public.cmte_report_types_view cr ON (((cr.report_type)::text = (duedate_by_report.report_type)::text)))
  GROUP BY cr.cmte_id, cr.form_type;


--
-- Name: reports_view; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.reports_view AS
 SELECT reports.report_id,
    reports.form_type,
    reports.amend_ind,
    reports.amend_number,
    reports.cmte_id,
    reports.report_type,
    ref_rpt_types.rpt_type_desc AS report_type_desc,
    reports.cvg_start_date,
    reports.cvg_end_date,
    reports.due_date,
    reports.superceded_report_id,
    reports.previous_report_id,
        CASE
            WHEN ((reports.status)::text = 'Submitted'::text) THEN 'Filed'::text
            WHEN ((reports.status)::text = 'Saved'::text) THEN 'Saved'::text
            WHEN ((reports.status)::text = 'Failed'::text) THEN 'Failed'::text
            ELSE 'Saved'::text
        END AS status,
    reports.memo_text,
    reports.filed_date,
    reports.fec_id,
    reports.fec_accepted_date,
    reports.fec_status,
    reports.most_recent_flag,
    reports.delete_ind,
    reports.create_date,
    reports.last_update_date,
        CASE
            WHEN (reports.delete_ind = 'Y'::bpchar) THEN reports.last_update_date
            ELSE NULL::timestamp without time zone
        END AS deleteddate
   FROM (public.reports
     LEFT JOIN public.ref_rpt_types ON (((reports.report_type)::text = (ref_rpt_types.rpt_type)::text)))
UNION
 SELECT forms_committeeinfo.id AS report_id,
    forms_committeeinfo.form_type,
    'N'::character varying AS amend_ind,
    0 AS amend_number,
    forms_committeeinfo.committeeid AS cmte_id,
    forms_committeeinfo.reason AS report_type,
    NULL::character varying AS report_type_desc,
    NULL::date AS cvg_start_date,
    NULL::date AS cvg_end_date,
    NULL::date AS due_date,
    NULL::bigint AS superceded_report_id,
    NULL::bigint AS previous_report_id,
        CASE
            WHEN (forms_committeeinfo.is_submitted = true) THEN 'Filed'::text
            WHEN (forms_committeeinfo.is_submitted = false) THEN 'Saved'::text
            WHEN (forms_committeeinfo.is_failed = true) THEN 'Failed'::text
            ELSE NULL::text
        END AS status,
    forms_committeeinfo.memo_text,
        CASE
            WHEN (forms_committeeinfo.is_submitted = true) THEN forms_committeeinfo.updated_at
            ELSE NULL::timestamp with time zone
        END AS filed_date,
    forms_committeeinfo.id AS fec_id,
    NULL::timestamp without time zone AS fec_accepted_date,
    NULL::character varying AS fec_status,
    'Y'::character varying AS most_recent_flag,
        CASE
            WHEN (forms_committeeinfo.isdeleted = true) THEN 'Y'::text
            ELSE NULL::text
        END AS delete_ind,
    NULL::timestamp without time zone AS create_date,
    forms_committeeinfo.updated_at AS last_update_date,
        CASE
            WHEN (forms_committeeinfo.isdeleted = true) THEN forms_committeeinfo.updated_at
            ELSE (NULL::timestamp without time zone)::timestamp with time zone
        END AS deleteddate
   FROM public.forms_committeeinfo;


