--
-- Name: temp_report_due_dates_view; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.temp_report_due_dates_view AS
 WITH duedate_by_ey_noney AS (
         WITH duedate_by_report AS (
                 WITH duedate AS (
                         SELECT t.report_type,
                            t.election_state,
                            t.report_year,
                            t.election_nonelection_year,
                            json_agg(json_build_object('election_date', t.election_date, 'cvg_start_date', t.cvg_start_date, 'cvg_end_date', t.cvg_end_date, 'due_date', t.due_date)) AS dates
                           FROM ( SELECT DISTINCT due_dates.report_type,
                                    due_dates.election_state,
                                    due_dates.election_date,
                                    due_dates.cvg_start_date,
                                    due_dates.cvg_end_date,
                                    due_dates.due_date,
                                    due_dates.report_year,
CASE
 WHEN (mod(due_dates.report_year, 2) = 0) THEN 'election-year'::text
 ELSE 'non-election-year'::text
END AS election_nonelection_year
                                   FROM public.due_dates
                                  WHERE (((due_dates.report_year)::double precision >= (date_part('year'::text, CURRENT_DATE) - (1)::double precision)) AND ((due_dates.report_year)::double precision <= date_part('year'::text, CURRENT_DATE)))
                                UNION
                                 SELECT 'TER'::character varying AS "varchar",
                                    NULL::character varying AS "varchar",
                                    NULL::date AS date,
                                    CURRENT_DATE AS "current_date",
                                    CURRENT_DATE AS "current_date",
                                    NULL::date AS date,
                                    date_part('year'::text, CURRENT_DATE) AS report_year,
CASE
 WHEN (mod((date_part('year'::text, CURRENT_DATE))::integer, 2) = 0) THEN 'election-year'::text
 ELSE 'non-election-year'::text
END AS election_nonelection_year) t
                          GROUP BY t.report_type, t.election_state, t.report_year, t.election_nonelection_year
                        )
                 SELECT duedate.report_type,
                    duedate.report_year,
                    duedate.election_nonelection_year,
                    json_agg(json_build_object('state', duedate.election_state, 'state_description', rs.state_description, 'dates', duedate.dates)) AS json_by_state
                   FROM (duedate
                     LEFT JOIN public.ref_states rs ON (((duedate.election_state)::text = (rs.state_code)::text)))
                  GROUP BY duedate.report_type, duedate.report_year, duedate.election_nonelection_year
                )
         SELECT cr.cmte_id,
            cr.form_type,
            duedate_by_report.report_year,
            cr.election_nonelection_year,
            json_agg(json_build_object('report_type', duedate_by_report.report_type, 'report_type_desciption', rrt.rpt_type_desc, 'report_type_info', rrt.rpt_type_info, 'regular_special_report_ind', rrt.regular_special_report_ind, 'default_disp_ind', public.is_default_report((cr.cmte_id)::bpchar, (duedate_by_report.report_type)::bpchar), 'election_state', duedate_by_report.json_by_state) ORDER BY rrt.rpt_type_order) AS report_types_json
           FROM ((duedate_by_report
             JOIN public.ref_rpt_types rrt ON (((duedate_by_report.report_type)::text = (rrt.rpt_type)::text)))
             JOIN public.cmte_report_types_view cr ON ((((cr.report_type)::text = (duedate_by_report.report_type)::text) AND ((cr.election_nonelection_year)::text = duedate_by_report.election_nonelection_year))))
          WHERE ((cr.cmte_id)::text = 'C00000935'::text)
          GROUP BY cr.cmte_id, cr.form_type, duedate_by_report.report_year, cr.election_nonelection_year
        )
 SELECT duedate_by_ey_noney.cmte_id,
    duedate_by_ey_noney.form_type,
    json_agg(json_build_object('type', duedate_by_ey_noney.election_nonelection_year, 'selected',
        CASE
            WHEN (((date_part('month'::text, CURRENT_DATE))::integer > 2) AND (((date_part('year'::text, CURRENT_DATE))::integer)::double precision = duedate_by_ey_noney.report_year)) THEN 'true'::text
            ELSE 'false'::text
        END, 'report_type', duedate_by_ey_noney.report_types_json)) AS tt
   FROM duedate_by_ey_noney
  GROUP BY duedate_by_ey_noney.cmte_id, duedate_by_ey_noney.form_type;


