--
-- Name: transaction_subcategory_json_view; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.transaction_subcategory_json_view AS
 WITH tran_sub_category AS (
         SELECT DISTINCT trc.form_type,
            trc.category_type,
            trc.sub_category_type,
            trc.sub_category_type_info,
            trc.category_order,
            trc.sub_category_order
           FROM public.transaction_categories trc
          WHERE ((trc.form_type)::text = 'F3X'::text)
          ORDER BY trc.category_order, trc.sub_category_order
        )
 SELECT tran_sub_category.form_type,
    json_agg(json_build_object('value', lower(replace((tran_sub_category.sub_category_type)::text, ' '::text, '-'::text)), 'text', tran_sub_category.sub_category_type, 'type', tran_sub_category.category_type, 'info', tran_sub_category.sub_category_type_info) ORDER BY tran_sub_category.category_order, tran_sub_category.sub_category_order) AS tran_subcategory
   FROM tran_sub_category
  GROUP BY tran_sub_category.form_type;


