COPY public.ref_form_types (form_type, form_description, form_info, form_pdf_url) FROM stdin;
F1	Statement of Organization (F1)                                                                                                                                                                                                                                                                              	Used to register candidates' authorized campaign committees, PACs and political party committees once they exceed applicable thresholds.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                	https://www.fec.gov/resources/cms-content/documents/fecfrm1i.pdf                                                                                                                                                                                                                                                                                                                                                                                                                                                    
F1M	Notification of Multicandidate Status (F1M)                                                                                                                                                                                                                                                                 	FEC FORM 1M discloses supplemental information that verifies the date on which your committee became a multicandidate committee.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                        	https://www.fec.gov/resources/cms-content/documents/fecfrm1mi.pdf                                                                                                                                                                                                                                                                                                                                                                                                                                                   
F2	Statement of Candidacy (F2)                                                                                                                                                                                                                                                                                 	Each individual who is a candidate for federal office must file FEC FORM 2 within 15 days of becoming a candidate.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                      	https://www.fec.gov/resources/cms-content/documents/fecfrm2i.pdf                                                                                                                                                                                                                                                                                                                                                                                                                                                    
F24	24/48 Hour Report of Independent Expenditures by a Committee (F24)                                                                                                                                                                                                                                          	Used by PACs and political party committees to submit 24 and 48-Hour Reports of Independent Expenditures.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               	https://www.fec.gov/resources/cms-content/documents/fecfrm3xei.pdf                                                                                                                                                                                                                                                                                                                                                                                                                                                  
F3	Congressional Report of Receipts and Disbursements (F3)                                                                                                                                                                                                                                                     	Used by House and Senate candidates' authorized committees to report receipts and disbursements.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                        	https://www.fec.gov/resources/cms-content/documents/fecfrm3i.pdf                                                                                                                                                                                                                                                                                                                                                                                                                                                    
F3L	Report of Contributions Bundled (F3L)                                                                                                                                                                                                                                                                       	Used by committees to report bundled contributions forwarded by or credited to lobbyists, registrants and their PACs.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   	https://www.fec.gov/resources/cms-content/documents/fecfrm3li.pdf                                                                                                                                                                                                                                                                                                                                                                                                                                                   
F3X	PAC and Party Report of Receipts and Disbursements (F3X)                                                                                                                                                                                                                                                    	Used by PACs and political party committees to report receipts and disbursements.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                       	https://www.fec.gov/resources/cms-content/documents/fecfrm3xi.pdf                                                                                                                                                                                                                                                                                                                                                                                                                                                   
F3P	Presidential Report of Receipts and Disbursements (F3P)                                                                                                                                                                                                                                                     	Used by presidential candidates' authorized committees to report receipts and disbursements.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                            	https://www.fec.gov/resources/cms-content/documents/fecfrm3pi.pdf                                                                                                                                                                                                                                                                                                                                                                                                                                                   
F4	Convention Report of Receipts and Disbursements (F4)                                                                                                                                                                                                                                                        	Used by committees that support a national nominating convention to report receipts and disbursements.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                  	https://www.fec.gov/resources/cms-content/documents/fecfrm4i.pdf                                                                                                                                                                                                                                                                                                                                                                                                                                                    
F5	Report of Independent Expenditures by a Person or Group (F5)                                                                                                                                                                                                                                                	Used by registered entities or Persons other than political committees to report independent expenditures made, and contributions received.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                             	https://www.fec.gov/resources/cms-content/documents/fecfrm5i.pdf                                                                                                                                                                                                                                                                                                                                                                                                                                                    
F6	48-Hour Notice of Contributions/Loans Received (F6)                                                                                                                                                                                                                                                         	Used by candidate committees that receive last-minute contributions of $1,000 of more.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                  	https://www.fec.gov/resources/cms-content/documents/fecfrm6i.pdf                                                                                                                                                                                                                                                                                                                                                                                                                                                    
F7	Report of Communication Costs (F7)                                                                                                                                                                                                                                                                          	Used by corporations and membership organizations other than political committees to report communication costs.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                        	https://www.fec.gov/resources/cms-content/documents/fecform7.pdf                                                                                                                                                                                                                                                                                                                                                                                                                                                    
F8	Debt Settlement Plan (F8)                                                                                                                                                                                                                                                                                   	Used by terminating committees attempting to settle debts for less than the full amount owed.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                           	https://www.fec.gov/resources/cms-content/documents/fecfrm8i.pdf                                                                                                                                                                                                                                                                                                                                                                                                                                                    
F9	24-Hour Notice for Electioneering Communications (F9)                                                                                                                                                                                                                                                       	Used by registered entities or persons other than political committees to report 24-hour notice of disbursements/obligations for electioneering communications. (C3 committees)                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                         	https://www.fec.gov/resources/cms-content/documents/fecform9i.pdf                                                                                                                                                                                                                                                                                                                                                                                                                                                   
F13	Inaugural Committee Report of Donations Accepted (F13)                                                                                                                                                                                                                                                      	Used by inaugural committees appointed by the President-elect to report donations accepted.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                             	https://www.fec.gov/resources/cms-content/documents/fecfrm13i.pdf                                                                                                                                                                                                                                                                                                                                                                                                                                                   
F99	Miscellaneous Report to the FEC (F99)                                                                                                                                                                                                                                                                       	Used by registered committees or entities filing electronically to submit a letter.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                     	                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                    
